import { ComparisonSlider } from 'react-comparison-slider';

export const ImageComparison = () => {
  return (
    <ComparisonSlider
      defaultValue={50}
      itemOne={<div className="bg-red"></div>}
      itemTwo={<div className="bg-blue"></div>}
      aspectRatio={16 / 9}
      orientation="horizontal"
    />
  );
};
